// src/App.js
import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";

// Import your actual components
// import Project from './Project'; // Your original component
// import AnalyticsDashboard from './AnalyticsDashboard'; // Your new component

// Temporary components for testing
function Home() {
  console.log('Rendering Home');
  return (
    <div>
      <h1>Home Page</h1>
      <nav>
        <Link to="/analytics">Go to Analytics</Link>
      </nav>
    </div>
  );
}

function Analytics() {
  console.log('Rendering Analytics');
  return (
    <div>
      <h1>Analytics Page</h1>
      <nav>
        <Link to="/">Go to Home</Link>
      </nav>
    </div>
  );
}

export default function App() {
  console.log('Rendering App with Router');

  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/analytics" element={<Analytics />} />
      </Routes>
    </Router>
  );
}
